import paddleObj from './data/paddleObj';

export default(context:CanvasRenderingContext2D, canvas:HTMLCanvasElement, paddle:paddleObj) => {
	class Paddle
	{
		x:number;
		y:number;
		height:number;
		width:number;
		color:string;
		constructor(x:number)
		{
			this.x = x;
			this.y = canvas.height - 30;
			this.height = 20;
			this.width = paddle.width;
			this.color = "red";
		}
	}
	move()
	{
		context.beginPath();
		context.rect(this.x, this.y, this.width, )
	}
	let padz = new Paddle(paddle.x);

}
